package com.hck.zhuanqian.bean;import org.codehaus.jackson.annotate.JsonAutoDetect;import org.codehaus.jackson.annotate.JsonProperty;import org.codehaus.jackson.map.annotate.JsonSerialize;@JsonSerialize(include = JsonSerialize.Inclusion.NON_NULL)@JsonAutoDetect(getterVisibility = JsonAutoDetect.Visibility.NONE, setterVisibility = JsonAutoDetect.Visibility.NONE)public class KindBean {	@JsonProperty("id")	private int id;	@JsonProperty("content")	private String content;	@JsonProperty("isok")	private int isOk;	@JsonProperty("num")	private int num;	@JsonProperty("neirong")	private String neirong;	@JsonProperty("aid")	private int aid;	@JsonProperty("paixun")	private int paixun;	public int getPaixun() {		return paixun;	}	public void setPaixun(int paixun) {		this.paixun = paixun;	}	public int getAid() {		return aid;	}	public void setAid(int aid) {		this.aid = aid;	}	public String getNeirong() {		return neirong;	}	public void setNeirong(String neirong) {		this.neirong = neirong;	}	public int getNum() {		return num;	}	public void setNum(int num) {		this.num = num;	}	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public int getIsOk() {		return isOk;	}	public void setIsOk(int isOk) {		this.isOk = isOk;	}}